import React from 'react';
import {Routes, Route} from 'react-douter-dom';
import Home from './pages/home';

export default () => {
    return (
        <Routes>    
            <Route exact path="/">
                Pagina inicial
            </Route>  
            <Route exact path="/config">
                Pagina conf
            </Route>
        </Routes>
    )
}
